Taiyo no oji: Horusu no daiboken (1968)
Little Norse Prince (USA) (TV title)
Prince of the Sun: The Great Adventure of Horus 

Director: Isao Takahata

Writer: Kazuo Fukazawa (writer)

Release Date: 21 July 1968 (Japan)

Genre: Animation | Fantasy


Plot: Horus, a kid living in a unnamed Scandinavian/Eastern Europe culture of the Iron Age, recovers the Sword of the Sun from the rock giant Moog and learns from his dying father that he must returns to his ancestral territory. In the process, he defends a village from the attacks of Grundewald, a warlord/ice demon and befriends the enigmatic Hilda, a lonely and beautiful girl who sings haunting songs (and who hides a terrible secret).  (Source: IMDB, by Korman643) &lt;a href=&quot;
